import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import Parse from 'parse';

const Admin = () => {
  const [isAdmin, setIsAdmin] = useState(false);
  const [adminPass, setAdminPass] = useState('');
  const [courseId, setCourseId] = useState('linux');
  const [formData, setFormData] = useState({
    instructor: '',
    zoomLink: '',
    videoLink: '',
    schedule: ''
  });

  const ADMIN_KEY = "snx_admin_2026"; // ·ÄÅ·ÄÑ·Ä∫·Äó·Äª·Ä¨·Ä∏·Äõ·Ä≤·Ä∑ ·ÄÖ·Ä≠·Äê·Ä∫·ÄÄ·Äº·Ä≠·ÄØ·ÄÄ·Ä∫ Password

  const checkPass = () => {
    if (adminPass === ADMIN_KEY) {
      setIsAdmin(true);
    } else {
      alert("Access Denied: Wrong Admin Password!");
    }
  };

  const handleUpdate = async (e) => {
    e.preventDefault();
    const Course = Parse.Object.extend("Classes");
    const query = new Parse.Query(Course);
    query.equalTo("courseId", courseId);

    try {
      let obj = await query.first();

      if (!obj) {
        alert("This course ID does not exist in Database. Please use 'Add New Class' first.");
        return;
      }

      // ·Äñ·Äº·Ää·Ä∑·Ä∫·Äë·Ä¨·Ä∏·Äê·Ä≤·Ä∑ data ·Äõ·Äæ·Ä≠·Äô·Äæ update ·Äú·ÄØ·Äï·Ä∫·Äô·Äö·Ä∫
      if (formData.instructor) obj.set("instructor", formData.instructor);
      if (formData.zoomLink) obj.set("zoomLink", formData.zoomLink);
      if (formData.videoLink) obj.set("videoLink", formData.videoLink);
      if (formData.schedule) obj.set("schedule", formData.schedule);

      await obj.save();
      alert("System Updated Successfully! ‚úÖ");
    } catch (err) {
      alert("Error: " + err.message);
    }
  };

  // Password ·Äô·Äù·ÄÑ·Ä∫·Äõ·Äû·Ä±·Ä∏·Äõ·ÄÑ·Ä∫ ·Äï·Äº·Äô·Äö·Ä∑·Ä∫ UI
  if (!isAdmin) {
    return (
      <div style={styles.loginWrapper}>
        <div style={styles.loginBox}>
          <h2 style={{ color: '#00ff41' }}>üõ° ADMIN ACCESS</h2>
          <input 
            type="password" 
            placeholder="Enter Admin Password" 
            style={styles.input} 
            onChange={(e) => setAdminPass(e.target.value)} 
          />
          <button onClick={checkPass} style={styles.btn}>VERIFY KEY</button>
          <div style={{ marginTop: '20px' }}>
            <Link to="/" style={{ color: '#8892b0', textDecoration: 'none', fontSize: '12px' }}>‚Üê Back to Home</Link>
          </div>
        </div>
      </div>
    );
  }

  // Password ·Äô·Äæ·Äî·Ä∫·Äõ·ÄÑ·Ä∫ ·Äï·Äº·Äô·Äö·Ä∑·Ä∫ UI
  return (
    <div style={{ backgroundColor: '#0a192f', minHeight: '100vh', color: '#00ff41', padding: '40px' }}>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '30px' }}>
        <h1>üõ† Admin Control Center</h1>
        <Link to="/add-class" style={styles.addBtn}>+ ADD NEW CLASS</Link>
      </div>

      <div style={styles.container}>
        <form onSubmit={handleUpdate} style={styles.form}>
          <label>Select Course to Update:</label>
          <select onChange={(e) => setCourseId(e.target.value)} style={styles.input}>
            <option value="linux">Linux Administration</option>
            <option value="cyber">Cyber Security</option>
            <option value="net">Networking</option>
            <option value="py_basic">Python (Basic)</option>
            <option value="py_adv">Python (Advanced)</option>
            <option value="hacking">Real World Hacking</option>
          </select>

          <input 
            type="text" placeholder="Instructor Name" style={styles.input} 
            onChange={(e)=>setFormData({...formData, instructor: e.target.value})} 
          />
          <input 
            type="text" placeholder="Zoom Link" style={styles.input} 
            onChange={(e)=>setFormData({...formData, zoomLink: e.target.value})} 
          />
          <input 
            type="text" placeholder="YouTube Video ID (e.g. dQw4w9WgXcQ)" style={styles.input} 
            onChange={(e)=>setFormData({...formData, videoLink: e.target.value})} 
          />
          <input 
            type="text" placeholder="Class Schedule" style={styles.input} 
            onChange={(e)=>setFormData({...formData, schedule: e.target.value})} 
          />

          <button type="submit" style={styles.btn}>UPDATE CLASS DATA</button>
        </form>

        <div style={{ marginTop: '20px' }}>
          <Link to="/dashboard" style={{ color: '#8892b0', textDecoration: 'none' }}>Go to Dashboard ‚Üí</Link>
        </div>
      </div>
    </div>
  );
};

const styles = {
  loginWrapper: { backgroundColor: '#0a192f', height: '100vh', display: 'flex', justifyContent: 'center', alignItems: 'center' },
  loginBox: { background: '#112240', padding: '40px', borderRadius: '10px', textAlign: 'center', border: '1px solid #00ff41' },
  container: { maxWidth: '600px' },
  form: { display: 'flex', flexDirection: 'column', gap: '15px', background: '#112240', padding: '30px', borderRadius: '10px' },
  input: { padding: '12px', background: '#0a192f', border: '1px solid #233554', color: '#fff', borderRadius: '5px', marginBottom: '10px' },
  btn: { padding: '15px', background: '#00ff41', color: '#0a192f', fontWeight: 'bold', border: 'none', cursor: 'pointer', borderRadius: '5px' },
  addBtn: { padding: '10px 20px', background: 'transparent', color: '#00ff41', border: '1px solid #00ff41', borderRadius: '5px', textDecoration: 'none', fontWeight: 'bold' }
};

export default Admin;
